import {
    CalendarContainer,
    CalendarPageWrapper,
    CalendarTimeColumn,
    CalendarTimeText
} from "../styled/CalendarPages.styled";

function SetupTutorAvailability() {
    return (
        <CalendarPageWrapper>
            <CalendarTimeColumn>
                <CalendarTimeText>8h00</CalendarTimeText>
                <CalendarTimeText>9h00</CalendarTimeText>
                <CalendarTimeText>10h00</CalendarTimeText>
                <CalendarTimeText>11h00</CalendarTimeText>
                <CalendarTimeText>12h00</CalendarTimeText>
                <CalendarTimeText>13h00</CalendarTimeText>
                <CalendarTimeText>14h00</CalendarTimeText>
                <CalendarTimeText>15h00</CalendarTimeText>
                <CalendarTimeText>16h00</CalendarTimeText>
                <CalendarTimeText>17h00</CalendarTimeText>
                <CalendarTimeText>18h00</CalendarTimeText>
            </CalendarTimeColumn>

        </CalendarPageWrapper>
    );
}

export default SetupTutorAvailability;
